import "./App.css";
import Formbuild from "./formbuild";
import DataCreator from "./dataCreator";
function App() {
  return (
    <div className="App">
      <div class="row-container page-break">
        <div class="row-fix">

          <div class="column w-5 align-center">

            <span class="font-style"> 1 </span>{" "}
          </div>{" "}
          <div class="column w-45 align-left">

            <p>

              Is the address given in the license or application for license
              same as the current address of the place of business?{" "}
            </p>{" "}
          </div>{" "}
          <div class="column w-2-5 align-center">

            <span class="value_text"> ::of_the_place_yes </span>{" "}
          </div>{" "}
          <div class="column w-2-5 align-center">

            <span class="value_text"> ::of_the_place_no </span>{" "}
          </div>{" "}
          <div class="column w-7 align-center">

            <span class="font-style"> A 1.4.6 </span>{" "}
          </div>{" "}
          <div class="column w-38 align-left">

            <span class="font-style"> ::of_the_place_remarks </span>{" "}
          </div>{" "}
        </div>{" "}
      </div>
      <div class="row-container page-break">
        <div class="row-fix">

          <div class="column w-5 align-center">

            <span class="font-style"> 2 </span>{" "}
          </div>{" "}
          <div class="column w-45 align-left">

            <p>

              Is a copy of RPS license granted under these rules prominently
              displayed at the premises of the RPS at a place accessible to
              public?{" "}
            </p>{" "}
          </div>{" "}
          <div class="column w-2-5 align-center">

            <span class="value_text"> ::displayed_at_the_yes </span>{" "}
          </div>{" "}
          <div class="column w-2-5 align-center">

            <span class="value_text"> ::displayed_at_the_no </span>{" "}
          </div>{" "}
          <div class="column w-7 align-center">

            <span class="font-style"> A 1.4.6 </span>{" "}
          </div>{" "}
          <div class="column w-38 align-left">

            <span class="font-style"> ::displayed_at_the_remarks </span>{" "}
          </div>{" "}
        </div>{" "}
      </div>
      <div class="row-container page-break">
        <div class="row-fix">

          <div class="column w-5 align-center">

            <span class="font-style"> 3 </span>{" "}
          </div>{" "}
          <div class="column w-45 align-left">

            <p>

              Is adequate resources and office infrastructure available for the
              RPS to provide its services?{" "}
            </p>{" "}
          </div>{" "}
          <div class="column w-2-5 align-center">

            <span class="value_text"> ::for_the_rps_yes </span>{" "}
          </div>{" "}
          <div class="column w-2-5 align-center">

            <span class="value_text"> ::for_the_rps_no </span>{" "}
          </div>{" "}
          <div class="column w-7 align-center">

            <span class="font-style"> A 1.4.6 </span>{" "}
          </div>{" "}
          <div class="column w-38 align-left">

            <span class="font-style"> ::for_the_rps_remarks </span>{" "}
          </div>{" "}
